//import logo from './logo.svg';
import React, { Component } from "react";
import './App.css';

class TimerWindow extends Component { 
  render() {
   return (
    <div className='column'>
      <div class="card">
        <div class="card-header">
          Bake Step Times
        </div>
        <ul class="list-group list-group-flush">
          <li class="list-group-item">Mix Initial Ingredients: </li>
          <li class="list-group-item">Room Temp Rise: </li>
          <li class="list-group-item">Cold Rise:</li>
          <li class="list-group-item">Bring To Room Temp:</li>
          <li class="list-group-item">More Ingredients:</li>
          <li class="list-group-item">Rise Room Temp:</li>
          <li class="list-group-item">Proof:</li>
          <li class="list-group-item">Bake:</li>
          <li class="list-group-item">Cool time:</li>
        </ul>
      </div>
    </div> 
    ); }
  }

function onPress() {
  alert("You clicked me!");
}

function App() {
  return (
    <div>
      <main className="container">
        <div className='header-box'>
          <h1 className="text-Black text-uppercase text-center my-4">BAKE BUDDY</h1>
        </div>
        <div className='row'>
          <div className='column'>
            <div className="col-md-6 col-sm-10 mx-auto p-0">
              <div className="card p-3">
                <button onClick={onPress}>BAKE</button>
              </div>
            </div>
          </div>
          <TimerWindow />
        </div>
      </main>
    </div>
  );
}

export default App;
